INSERT INTO `v1_7680e4d125f6d9955a1a7d9b59ef73801945abb97a1dcfa556516684ab472445` VALUES (104711, 10, "うん、そうだよ。\n【王宮騎士団（NIGHTMARE）】\nと少年から、またひとつ成長した\nトモちゃんにプレゼントだ。", 0, 1, 11, 17814070, 0, 0.5, 1, 17814);
