INSERT INTO `v1_7680e4d125f6d9955a1a7d9b59ef73801945abb97a1dcfa556516684ab472445` VALUES (100811, 10, "今日は何の日か、もちろん分かるよね？\nこの世で一番かわいくて美しいボクが\n誕生して、みんなの美意識が刷新された\nことをお祝いする、世界的記念日だよ♪", 0, 1, 11, 23814070, 0, 0.5, 1, 23814);
