INSERT INTO `v1_7680e4d125f6d9955a1a7d9b59ef73801945abb97a1dcfa556516684ab472445` VALUES (104511, 10, "そ、そうだったんですか……？\nクウカは、あんまり歴史とか時事とかに\n詳しくないので、そんなすごい日\nだったなんて知りませんでした……", 0, 1, 11, 23814074, 0, 0.5, 1, 23814);
