INSERT INTO `v1_7680e4d125f6d9955a1a7d9b59ef73801945abb97a1dcfa556516684ab472445` VALUES ("vo_wac_27814", 0, "vo_wac_27814_002", "", "", 21, 27814077, "", "", 0, 27814);
INSERT INTO `v1_7680e4d125f6d9955a1a7d9b59ef73801945abb97a1dcfa556516684ab472445` VALUES (105511, 10, "お、お誕生日\nおめでとうございます、クウカさん。\nせ、せっかく、ケーキを用意したので、\nみんなでこれを食べませんか……？", 0, 1, 11, 27814078, 0, 0.5, 1, 27814);
