INSERT INTO `v1_7680e4d125f6d9955a1a7d9b59ef73801945abb97a1dcfa556516684ab472445` VALUES (104711, 10, "おめでとう、マツリちゃん。\n私たちだけではなく、\n少年も一緒に準備してくれたんだよ。", 0, 1, 11, 28414073, 0, 0.5, 1, 28414);
