INSERT INTO `v1_7680e4d125f6d9955a1a7d9b59ef73801945abb97a1dcfa556516684ab472445` VALUES (100411, 10, "まじめだな～、キョウカは。\nミソギがケーキをもらったときは、\nまずどの飾りから食べようかなーって\n思ってたくらいなのに。", 0, 1, 11, 35314063, 0, 0.5, 1, 35314);
