INSERT INTO `v1_7680e4d125f6d9955a1a7d9b59ef73801945abb97a1dcfa556516684ab472445` VALUES (100511, 10, "大体クリスティーナおばさんが\n問題だらけなのは最初からであって、\nそんなのもう誰も気にしてないッスよ！", 0, 1, 11, 35814075, 0, 0.5, 1, 35814);
